import React from "react";
import listClubs from "./ClubList";

const Club = (props) => {
  return (
    <div>
      <i alt="img-icon-club"> {props.icon}</i>
      <h2> {props.name}</h2>
      <ul>
        {" "}
        {props.members.map((item) => (
          <li>{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default Club;
